<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Photo Editor</title>
    <style>
        body {
            background-color: #121212;
            color: white;
            font-family: Arial, sans-serif;
            text-align: center;
            padding: 20px;
			
        }
        .upload-container {
            padding: 20px;
            background: #1e1e1e;
            border-radius: 10px;
            display: inline-block;
            width: 90%;
            max-width: 400px;
        }
        .upload-image {
            width: 70%;
            height: auto;
        }
        .upload-title {
            font-size: 24px;
            font-weight: bold;
            margin: 10px 0;
        }
        .upload-description {
            font-size: 14px;
            color: #b0b0b0;
            margin-bottom: 15px;
        }
        .upload-button {
            background: white;
            color: black;
            border: none;
            padding: 12px 20px;
            border-radius: 5px;
            cursor: pointer;
            font-size: 16px;
            display: flex;
            align-items: center;
            gap: 10px;
            justify-content: center;
            width: 90%;
        }
        .upload-button i {
            font-size: 18px;
        }
        .image-container {
            margin-top: 20px;
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
            gap: 20px;
            justify-content: center;
            width: 100%;
            max-width: 1200px;
            margin: 20px auto;
        }
        .image-wrapper {
            background: #1e1e1e;
            padding: 15px;
            border-radius: 10px;
            display: flex;
            flex-direction: column;
            align-items: center;
            text-align: center;
        }
        img {
            max-width: 100%;
            border-radius: 10px;
            filter: 
                brightness(64%) contrast(78%) saturate(85%)
                sepia(0%) hue-rotate(13deg) invert(0%)
                opacity(100%) grayscale(0%)
                drop-shadow(0 0 5px rgba(255,255,255,0.2));
        }
        .download-button {
            margin-top: 10px;
            background: white;
            color: black;
            border: none;
            padding: 10px 15px;
            border-radius: 5px;
            cursor: pointer;
            width: 100%;
        }
        .download-all {
            margin-top: 10px;
            background: white;
            color: black;
            border: none;
            padding: 10px 15px;
            border-radius: 5px;
            cursor: pointer;
            display: none;
            width: 200px;
            text-align: center;
            margin-left: auto;
            margin-right: auto;
			
        }
        @media (max-width: 768px) {
            .image-container {
                grid-template-columns: 1fr;
            }
        }
    </style>
</head>

        <div class="upload-title">Upload Your Photos</div>
        <div class="upload-description">Enhance your photos with advanced filters and download them easily.</div>
        <label class="upload-button">
            Upload Photo(s)
            <input type="file" id="imageInput" multiple accept="image/*" style="display:none;">
        </label>
    </div>
    <button id="downloadAll" class="download-all">Download All</button>
    <div class="image-container" id="imageContainer"></div>
    <script>
        document.getElementById('imageInput').addEventListener('change', function(event) {
            const container = document.getElementById('imageContainer');
            const downloadAllBtn = document.getElementById('downloadAll');
            container.innerHTML = '';
            
            if (event.target.files.length > 0) {
                downloadAllBtn.style.display = 'block';
            } else {
                downloadAllBtn.style.display = 'none';
            }
            
            Array.from(event.target.files).forEach((file, index) => {
                const reader = new FileReader();
                reader.onload = function(e) {
                    const wrapper = document.createElement('div');
                    wrapper.classList.add('image-wrapper');
                    
                    const img = document.createElement('img');
                    img.src = e.target.result;
                    
                    const downloadButton = document.createElement('button');
                    downloadButton.innerText = 'Download';
                    downloadButton.classList.add('download-button');
                    downloadButton.onclick = function() {
                        const a = document.createElement('a');
                        a.href = img.src;
                        a.download = `edited-image-${index + 1}.png`;
                        document.body.appendChild(a);
                        a.click();
                        document.body.removeChild(a);
                    };
                    
                    wrapper.appendChild(img);
                    wrapper.appendChild(downloadButton);
                    container.appendChild(wrapper);
                };
                reader.readAsDataURL(file);
            });
        });
        
        document.getElementById('downloadAll').addEventListener('click', function() {
            document.querySelectorAll('.image-wrapper img').forEach((img, index) => {
                const a = document.createElement('a');
                a.href = img.src;
                a.download = `edited-image-${index + 1}.png`;
                document.body.appendChild(a);
                a.click();
                document.body.removeChild(a);
            });
        });
    </script>
</body>
</html>
